webpackJsonp([43969229265368],{821:function(n,a){n.exports={data:{post:{id:"/home/travis/build/benmvp/benmvp.github.io/content/posts/2016-01-13--learning-es6-generators-as-iterators/index.md absPath of file >>> MarkdownRemark",html:'<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/electric-generator-93d0cfb5a7cb2fba0ba4606254ef2a37-00e6e.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 768px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 76.95312500000001%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="electric generator"\n        title=""\n        src="/static/electric-generator-93d0cfb5a7cb2fba0ba4606254ef2a37-00e6e.jpg"\n        srcset="/static/electric-generator-93d0cfb5a7cb2fba0ba4606254ef2a37-5a774.jpg 200w,\n/static/electric-generator-93d0cfb5a7cb2fba0ba4606254ef2a37-40103.jpg 400w,\n/static/electric-generator-93d0cfb5a7cb2fba0ba4606254ef2a37-00e6e.jpg 768w"\n        sizes="(max-width: 768px) 100vw, 768px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>I feel like all the articles in the <a href="/learning-es6-series/"><em>Learning ES6</em> series</a> have been leading up to generators. They really are the feature most JavaScript developers are excited about in ECMAScript 6. They very well may be the future of asynchronous programming in JavaScript. That’s definitely something to get excited about!</p>\n<p>Generators can be used both as data producers and data consumers. In this article, we’re going to look at how generator functions are a much more convenient way to produce data and and create iterators. It’s the simpler way to use generators. In the last article we covered <a href="/learning-es6-iterators-iterables/">iterators &#x26; iterables</a>, so you may need to familiarize yourself with that before looking at generators as iterators.</p>\n<h2 id="tldr"><a href="#tldr" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>TL;DR</h2>\n<p>A generator function is a special type of function that when invoked automatically generates a special iterator, called a <em>generator</em> object. Generator functions are indicated by <code class="language-text">function*</code> and make use of the <code class="language-text">yield</code> operator to indicate the value to return for each successive call to <code class="language-text">.next()</code> on the generator.</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">function</span><span class="token operator">*</span> <span class="token function">range</span><span class="token punctuation">(</span>start<span class="token punctuation">,</span> count<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token keyword">for</span> <span class="token punctuation">(</span><span class="token keyword">let</span> delta <span class="token operator">=</span> <span class="token number">0</span><span class="token punctuation">;</span> delta <span class="token operator">&lt;</span> count<span class="token punctuation">;</span> delta<span class="token operator">++</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token keyword">yield</span> start <span class="token operator">+</span> delta<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n<span class="token punctuation">}</span>\n\n<span class="token keyword">for</span> <span class="token punctuation">(</span><span class="token keyword">let</span> teenageYear <span class="token keyword">of</span> <span class="token function">range</span><span class="token punctuation">(</span><span class="token number">13</span><span class="token punctuation">,</span> <span class="token number">7</span><span class="token punctuation">)</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token template-string"><span class="token string">`Teenage angst @ </span><span class="token interpolation"><span class="token interpolation-punctuation punctuation">${</span>teenageYear<span class="token interpolation-punctuation punctuation">}</span></span><span class="token string">!`</span></span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p>Feel free to clone the <a href="https://github.com/benmvp/learning-es6"><em>Learning ES6</em> Github repo</a> and take a look at the <a href="/learning-es6/#generators">generators code examples</a> page showing them off in greater detail.</p>\n<p>With out further ado, let’s keep reading.</p>\n<h2 id="quick-overview"><a href="#quick-overview" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Quick overview</h2>\n<p>Generator functions are a new type of function in ES6 that are indicated by <code class="language-text">function*</code> and return a generator object (which is a specific type of iterator). The heart of a generator function is the <code class="language-text">yield</code> operator that pauses execution within the generator function:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">function</span><span class="token operator">*</span> <span class="token function">generatorFunc</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">\'before yield\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n    <span class="token keyword">yield</span><span class="token punctuation">;</span>\n    console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">\'after yield\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n\n<span class="token keyword">let</span> generator <span class="token operator">=</span> <span class="token function">generatorFunc</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// nothing has happened yet, just have a generator</span>\n\n<span class="token comment">// output:</span>\n<span class="token comment">// before yield</span>\n<span class="token comment">// {value: undefined, done: false}</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>generator<span class="token punctuation">.</span><span class="token function">next</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// this will be executed before \'after yield\'</span>\n<span class="token comment">// is written to the log</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">\'after first next\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// Output:</span>\n<span class="token comment">// after yield</span>\n<span class="token comment">// {value: undefined, done: true}</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>generator<span class="token punctuation">.</span><span class="token function">next</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// additional calls to .next() do nothing</span>\n\n<span class="token comment">// Output:</span>\n<span class="token comment">// {value: undefined, done: false}</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>generator<span class="token punctuation">.</span><span class="token function">next</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>As you can see, calling <code class="language-text">generatorFunc()</code> doesn’t execute the function. It just returns a generator object which we assign to <code class="language-text">generator</code>. It’s <code class="language-text">generator</code> that will allow us to control <code class="language-text">generatorFunc</code>’s execution. Before calling <code class="language-text">generator.next()</code>, <code class="language-text">generatorFunc</code> is kind of in a holding pattern at the beginning of its function body. It’s not until <code class="language-text">.next()</code> is called that execution begins and continues until the first <code class="language-text">yield</code>. Everything prior to that first <code class="language-text">yield</code> is executed (so <code class="language-text">&#39;before yield&#39;</code> is logged to console).</p>\n<p>An object with a value is returned, but that <code class="language-text">value</code> is <code class="language-text">undefined</code> because we haven’t provided an operand for <code class="language-text">yield</code>. We’ll talk more about <code class="language-text">yield</code>ing values in a bit so it’s ok if that doesn’t make too much sense just yet.</p>\n<p><code class="language-text">generatorFunction()</code> is now paused at the <code class="language-text">yield</code> line, right in the middle of the function. Execution now returns back to the main program where <code class="language-text">&#39;after first next&#39;</code> is logged to the console.</p>\n<p>The subsequent call to <code class="language-text">generator.next()</code> continues execution in the generator function. <code class="language-text">&#39;after yield&#39;</code> is now logged to the console and the function finishes. The call to <code class="language-text">.next()</code> returns another object, this time with <code class="language-text">done</code> set to <code class="language-text">true</code>. Any additional calls to <code class="language-text">generator.next()</code> have no effect.</p>\n<p>This is the barebones of how generator functions work. A generator object can be created in four ways…</p>\n<p>From a generator function declaration (same as example above):</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">function</span><span class="token operator">*</span> <span class="token function">generatorFunc</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token keyword">yield</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n<span class="token keyword">let</span> generator <span class="token operator">=</span> <span class="token function">generatorFunc</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>From a generator function expression:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">const</span> <span class="token function-variable function">generatorFunc</span> <span class="token operator">=</span> <span class="token keyword">function</span><span class="token operator">*</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token keyword">yield</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n<span class="token keyword">let</span> generator <span class="token operator">=</span> <span class="token function">generatorFunc</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>From a generator method definition in an object literal:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> someObj <span class="token operator">=</span> <span class="token punctuation">{</span>\n    <span class="token operator">*</span><span class="token function">generatorFunc</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token keyword">yield</span><span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span>\n<span class="token keyword">let</span> generator <span class="token operator">=</span> someObj<span class="token punctuation">.</span><span class="token function">generatorFunc</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>From a generator method definition in a class definition (declaration or expression):</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">class</span> <span class="token class-name">SomeClass</span> <span class="token punctuation">{</span>\n    <span class="token operator">*</span><span class="token function">generatorFunc</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token keyword">yield</span><span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n<span class="token punctuation">}</span>\n<span class="token keyword">let</span> someObj <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">SomeClass</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token keyword">let</span> generator <span class="token operator">=</span> someObj<span class="token punctuation">.</span><span class="token function">generatorFunc</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>The most basic form of a generator object acts as a data producer, aka an iterator. It returns a value for each iteration. If you haven’t had a chance to read up on <a href="/learning-es6-iterators-iterables/">iterators &#x26; iterables</a>, you probably should do that first. Everything we’ll cover in this section builds upon that knowledge.</p>\n<p>As the article on iterators mentioned, we most likely won’t be implementing iterators directly because of generators. Generator functions make it dead simple to create iterators (although understanding them isn’t quite so simple). All we have to do is write the looping behavior because all generators have built-in implementations for <code class="language-text">.next()</code> and <code class="language-text">[Symbol.iterator]()</code>. This makes generators both iterators as well as iterables. As a refresher, here’s the iterable interface written using <a href="http://typescriptlang.org/">TypeScript</a>:</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">interface Iterable {\n    // default iterator\n    [System.iterator]() : Iterator;\n}\ninterface Iterator {\n    // next method to continue iteration\n    next() : IteratorResult;\n\n    // optional return method\n    return?(value? : any) : IteratorResult;\n}\ninterface IteratorResult {\n    value : any;\n    done : boolean;\n}</code></pre>\n      </div>\n<h2 id="creating-a-generator"><a href="#creating-a-generator" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Creating a generator</h2>\n<p>So how much easier is it to create a generator versus a plain iterator? Well let’s adapt an example from <a href="https://twitter.com/jorendorff">Jason Orendorff</a>’s <a href="https://hacks.mozilla.org/2015/05/es6-in-depth-generators/">ES6 In Depth: Generators</a> blog post. Let’s say we want a <code class="language-text">range()</code> function that will return an iterator that will iterate from the specified <code class="language-text">start</code> for a specified <code class="language-text">count</code> number of times:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">class</span> <span class="token class-name">RangeIterator</span> <span class="token punctuation">{</span>\n    <span class="token function">constructor</span><span class="token punctuation">(</span>start<span class="token punctuation">,</span> count<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token keyword">this</span><span class="token punctuation">.</span>start <span class="token operator">=</span> start<span class="token punctuation">;</span>\n        <span class="token keyword">this</span><span class="token punctuation">.</span>count <span class="token operator">=</span> count<span class="token punctuation">;</span>\n        <span class="token keyword">this</span><span class="token punctuation">.</span>delta <span class="token operator">=</span> <span class="token operator">-</span><span class="token number">1</span><span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n\n    <span class="token punctuation">[</span>Symbol<span class="token punctuation">.</span>iterator<span class="token punctuation">]</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span> <span class="token keyword">return</span> <span class="token keyword">this</span><span class="token punctuation">;</span> <span class="token punctuation">}</span>\n\n    <span class="token function">next</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token keyword">this</span><span class="token punctuation">.</span>delta<span class="token operator">++</span><span class="token punctuation">;</span>\n\n        <span class="token keyword">let</span> value <span class="token operator">=</span> <span class="token keyword">this</span><span class="token punctuation">.</span>start <span class="token operator">+</span> <span class="token keyword">this</span><span class="token punctuation">.</span>delta<span class="token punctuation">;</span>\n\n        <span class="token keyword">if</span> <span class="token punctuation">(</span>value <span class="token operator">&lt;</span> <span class="token keyword">this</span><span class="token punctuation">.</span>start <span class="token operator">+</span> <span class="token keyword">this</span><span class="token punctuation">.</span>count<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n            <span class="token keyword">return</span> <span class="token punctuation">{</span>value<span class="token punctuation">}</span><span class="token punctuation">;</span> <span class="token comment">// using object literal shorthand</span>\n        <span class="token punctuation">}</span>\n        <span class="token keyword">else</span> <span class="token punctuation">{</span>\n            <span class="token keyword">return</span> <span class="token punctuation">{</span>done<span class="token punctuation">:</span> <span class="token boolean">true</span><span class="token punctuation">}</span><span class="token punctuation">;</span>\n        <span class="token punctuation">}</span>\n    <span class="token punctuation">}</span>\n<span class="token punctuation">}</span>\n\n<span class="token comment">// Return a new iterator that will iterate from `start` for</span>\n<span class="token comment">// `count` number of times</span>\n<span class="token keyword">function</span> <span class="token function">range</span><span class="token punctuation">(</span>start<span class="token punctuation">,</span> count<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token keyword">return</span> <span class="token keyword">new</span> <span class="token class-name">RangeIterator</span><span class="token punctuation">(</span>start<span class="token punctuation">,</span> count<span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n\n<span class="token keyword">for</span> <span class="token punctuation">(</span><span class="token keyword">let</span> teenageYear <span class="token keyword">of</span> <span class="token function">range</span><span class="token punctuation">(</span><span class="token number">13</span><span class="token punctuation">,</span> <span class="token number">7</span><span class="token punctuation">)</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token template-string"><span class="token string">`Teenage angst @ </span><span class="token interpolation"><span class="token interpolation-punctuation punctuation">${</span>teenageYear<span class="token interpolation-punctuation punctuation">}</span></span><span class="token string">!`</span></span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p>This isn’t overly complicated, but there sure is a whole lot of boilerplate to implement the <code class="language-text">RangeIteartor</code>. Generators to the rescue!</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token comment">// Return a new generator that will iterate from `start` for</span>\n<span class="token comment">// `count` number of times</span>\n<span class="token keyword">function</span><span class="token operator">*</span> <span class="token function">range</span><span class="token punctuation">(</span>start<span class="token punctuation">,</span> count<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token keyword">for</span> <span class="token punctuation">(</span><span class="token keyword">let</span> delta <span class="token operator">=</span> <span class="token number">0</span><span class="token punctuation">;</span> delta <span class="token operator">&lt;</span> count<span class="token punctuation">;</span> delta<span class="token operator">++</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token keyword">yield</span> start <span class="token operator">+</span> delta<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n<span class="token punctuation">}</span>\n\n<span class="token keyword">for</span> <span class="token punctuation">(</span><span class="token keyword">let</span> teenageYear <span class="token keyword">of</span> <span class="token function">range</span><span class="token punctuation">(</span><span class="token number">13</span><span class="token punctuation">,</span> <span class="token number">7</span><span class="token punctuation">)</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token template-string"><span class="token string">`Teenage angst @ </span><span class="token interpolation"><span class="token interpolation-punctuation punctuation">${</span>teenageYear<span class="token interpolation-punctuation punctuation">}</span></span><span class="token string">!`</span></span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p>Wow! We just spent many articles going through the syntactic sugar features of ES6 learning how it made our code more succinct. But we just used the new generator functionality to replace 25+ lines of code with only 4! We no longer have to define the <code class="language-text">RangeIterator</code> class because generator functions automatically create the class for us. And the best part of the generator function implementation is that we get to avoid the weirdness of <code class="language-text">RangeIterator</code> where it describes the functionality of a loop without using any loop syntax. It has to use state variables (<code class="language-text">this.start</code>, <code class="language-text">this.count</code> &#x26; <code class="language-text">this.index</code>) to manage the looping behavior across multiple calls to <code class="language-text">.next()</code>. Generators are <em>much</em> better.</p>\n<h2 id="consuming-a-generator"><a href="#consuming-a-generator" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Consuming a generator</h2>\n<p>In the article on <a href="/learning-es6-iterators-iterables/#other-consumers-of-iterators">iterators &#x26; iterators</a>, we looked at consumers of iterators. Those same consumers work with generators as well since they are in fact iterators. Let’s look at the different ways we can consume the generator created by the following function:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">function</span><span class="token operator">*</span> <span class="token function">awesomeGeneratorFunc</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">\'start\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n    console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">\'first yield\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n    <span class="token keyword">yield</span> <span class="token string">\'Generators\'</span><span class="token punctuation">;</span>\n\n    console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">\'second yield\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n    <span class="token keyword">yield</span> <span class="token string">\'are\'</span><span class="token punctuation">;</span>\n\n    console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">\'third yield\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n    <span class="token keyword">yield</span> <span class="token string">\'awesome!\'</span><span class="token punctuation">;</span>\n\n    console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">\'all done!\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n    <span class="token keyword">return</span> <span class="token number">1000</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<h3 id="consuming-a-generator-manually"><a href="#consuming-a-generator-manually" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Consuming a generator manually</h3>\n<p>As we saw earlier in the <a href="#quick-overview">quick overview</a>, we can manually consume a generator by calling <code class="language-text">.next()</code> on it:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> generatorObj <span class="token operator">=</span> <span class="token function">awesomeGeneratorFunc</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// output:</span>\n<span class="token comment">// start</span>\n<span class="token comment">// first yield</span>\n<span class="token comment">// {value: \'Generators\', done: false}</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>generatorObj<span class="token punctuation">.</span><span class="token function">next</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// output:</span>\n<span class="token comment">// second yield</span>\n<span class="token comment">// {value: \'are\', done: false}</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>generatorObj<span class="token punctuation">.</span><span class="token function">next</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// output:</span>\n<span class="token comment">// third yield</span>\n<span class="token comment">// {value: \'awesome!\', done: false}</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>generatorObj<span class="token punctuation">.</span><span class="token function">next</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// output:</span>\n<span class="token comment">// all done!</span>\n<span class="token comment">// {value: 1000, done: true}</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>generatorObj<span class="token punctuation">.</span><span class="token function">next</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// output:</span>\n<span class="token comment">// {value: undefined, done: true}</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>generatorObj<span class="token punctuation">.</span><span class="token function">next</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// output:</span>\n<span class="token comment">// {value: undefined, done: true}</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>generatorObj<span class="token punctuation">.</span><span class="token function">next</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>Manually consuming a generator shows the pausing nature of generator functions. We’re just successively calling <code class="language-text">.next()</code> to keep the example simple, but we could do a whole host of things in between calls to <code class="language-text">.next()</code> and the generator function would stay “suspended” until a subsequent call to <code class="language-text">.next()</code>.</p>\n<p>The only thing really new in this example is that <code class="language-text">awesomeGeneratorFunc()</code> actually returns a value. But <code class="language-text">1000</code> is not what is assigned to <code class="language-text">generatorObj</code>; it is still a generator object. <code class="language-text">1000</code> gets set as the <code class="language-text">value</code> when the generator is done for the first time (<code class="language-text">{value: 1000, done: true}</code>). Subsequent calls to <code class="language-text">.next()</code> return an <code class="language-text">undefined</code> <code class="language-text">value</code> when <code class="language-text">done</code> is <code class="language-text">true</code>. We’ll look at the use case for this return value later on when we look at <code class="language-text">yield*</code>.</p>\n<h3 id="consuming-a-generator-with-a-code-classlanguage-textfor-ofcode-loop"><a href="#consuming-a-generator-with-a-code-classlanguage-textfor-ofcode-loop" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Consuming a generator with a <code class="language-text">for-of</code> loop</h3>\n<p>Even though our generator doesn’t actually do any looping (like the <a href="#creating-a-generator"><code class="language-text">range()</code></a> function from before) it can still be consumed by a <code class="language-text">for-of</code> loop:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> generatorObj <span class="token operator">=</span> <span class="token function">awesomeGeneratorFunc</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// output:</span>\n<span class="token comment">// start</span>\n<span class="token comment">// first yield</span>\n<span class="token comment">// value: "Generators"</span>\n<span class="token comment">// second yield</span>\n<span class="token comment">// value: "are"</span>\n<span class="token comment">// third yield</span>\n<span class="token comment">// value: "awesome!"</span>\n<span class="token comment">// all done!</span>\n<span class="token keyword">for</span> <span class="token punctuation">(</span><span class="token keyword">let</span> word <span class="token keyword">of</span> generatorObj<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token template-string"><span class="token string">`value: "</span><span class="token interpolation"><span class="token interpolation-punctuation punctuation">${</span>word<span class="token interpolation-punctuation punctuation">}</span></span><span class="token string">"`</span></span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p>The <code class="language-text">for-of</code> operator calls <code class="language-text">.next()</code> on the <code class="language-text">generatorObj</code> automatically and assigns the <code class="language-text">value</code> property to <code class="language-text">word</code>. We see here that <code class="language-text">for-of</code> consumes the generator until the generator is completed (<code class="language-text">{done: true}</code>) and then it stops looping.  However it doesn’t utilize the <code class="language-text">1000</code> return value at all. It’s also worth pointing out that if we had a <code class="language-text">break</code> in the loop, the generator never would’ve completed.</p>\n<h3 id="consuming-a-generator-with-destructuring"><a href="#consuming-a-generator-with-destructuring" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Consuming a generator with destructuring</h3>\n<p>By now you should be familiar with destructuring. If you aren’t, take a look at the <a href="/learning-es6-destructuring/">destructuring</a> article to ramp up. We can use destructuring to consume part of the generator values:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> generatorObj <span class="token operator">=</span> <span class="token function">awesomeGeneratorFunc</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// output:</span>\n<span class="token comment">// start</span>\n<span class="token comment">// first yield</span>\n<span class="token comment">// second yield</span>\n<span class="token keyword">let</span> <span class="token punctuation">[</span>firstValue<span class="token punctuation">,</span> secondValue<span class="token punctuation">]</span> <span class="token operator">=</span> generatorObj<span class="token punctuation">;</span>\n\n<span class="token comment">// output: \'Generators\'</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>firstValue<span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// output: \'are\'</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>secondValue<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>With destructuring we don’t have to consume the entire generator. We can just pull out the values that we care about. In this case we’re only pulling out the first two values so the generator only calls <code class="language-text">.next()</code> twice. We never see <code class="language-text">&#39;third yield&#39;</code> written to the log, proving that the generator is indeed lazy just like iterators.</p>\n<h3 id="consuming-a-generator-with-the-spread-operator"><a href="#consuming-a-generator-with-the-spread-operator" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Consuming a generator with the spread operator</h3>\n<p>We’ve already learned that we can use the <a href="/learning-es6-parameter-handling/#spread-operator">spread operator</a> as a shorthand for converting any iterable into an <code class="language-text">Array</code> object. A generator object is an iterable too!</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">let</span> generatorObj <span class="token operator">=</span> <span class="token function">awesomeGeneratorFunc</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token keyword">let</span> generatedArray <span class="token operator">=</span> <span class="token punctuation">[</span><span class="token operator">...</span>generatorObj<span class="token punctuation">]</span><span class="token punctuation">;</span>\n\n<span class="token comment">// output:</span>\n<span class="token comment">// start</span>\n<span class="token comment">// first yield</span>\n<span class="token comment">// second yield</span>\n<span class="token comment">// third yield</span>\n<span class="token comment">// all done!</span>\n<span class="token comment">// [\'Generators\', \'are\', \'awesome!\']</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>generatedArray<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>As we can see, the spread operator consumes until completion in order to create the array. Using the new <code class="language-text">Array.from()</code> static method would also have the same effect and results. We can then utilize all of the methods on an <code class="language-text">Array</code> object (like <code class="language-text">.forEach</code>, <code class="language-text">.map</code>, etc.).</p>\n<h2 id="generator-recursion-with-code-classlanguage-textyieldcode"><a href="#generator-recursion-with-code-classlanguage-textyieldcode" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Generator recursion with <code class="language-text">yield*</code></h2>\n<p>Head hurting yet? If not, it definitely will as we start talking about <code class="language-text">yield*</code>!</p>\n<p>There will be times when we want to combine the values of one or more generators into a single one. Or, we want to factor out generator logic into a separate function so that it can be used multiple times. With “regular” programming we would just create the factored out function and call it as needed.</p>\n<p>However, it’s not as simple in generator land. We don’t want to call the helper generator function to get back its return value. If we did that, we’d just get a new generator for that helper generator function. We actually want it to continue to <code class="language-text">yield</code> into our <em>current</em> generator. What we want to do is delegate the generator’s population to another generator function.</p>\n<p>And we can do this using <code class="language-text">yield*</code>:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">function</span><span class="token operator">*</span> <span class="token function">delegatedGeneratorFunc</span><span class="token punctuation">(</span>start<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token comment">// yield the first item in the generator</span>\n    <span class="token keyword">yield</span> <span class="token string">\'before\'</span><span class="token punctuation">;</span>\n\n    <span class="token comment">// delegate yielding to `awesomeGeneratorFunc()` which will add</span>\n    <span class="token comment">// 3 more items</span>\n    <span class="token keyword">yield</span><span class="token operator">*</span> <span class="token function">awesomeGeneratorFunc</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n    <span class="token comment">// yield 5th item</span>\n    <span class="token keyword">yield</span> <span class="token string">\'between\'</span><span class="token punctuation">;</span>\n\n    <span class="token comment">// delegate yielding to `range()` which will add 5 items</span>\n    <span class="token comment">// we can pass parameters/variables just like regular functions</span>\n    <span class="token comment">// without `yield*` we\'d just get back a new range generator</span>\n    <span class="token comment">// with only `yield`, the generator would be added as 10th item</span>\n    <span class="token keyword">yield</span><span class="token operator">*</span> <span class="token function">range</span><span class="token punctuation">(</span>start<span class="token punctuation">,</span> <span class="token number">5</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n    <span class="token comment">// yield 11th and final item</span>\n    <span class="token keyword">yield</span> <span class="token string">\'after\'</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n\n<span class="token comment">// quickly see contents of generator by converting to an array</span>\n<span class="token comment">// output:</span>\n<span class="token comment">// [\'before\', \'Generators\', \'area\', \'awesome\', \'between\', 1, 2, 3, 4, 5, \'after\']</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token punctuation">[</span><span class="token operator">...</span><span class="token function">delegatedGeneratorFunc</span><span class="token punctuation">(</span><span class="token number">1</span><span class="token punctuation">)</span><span class="token punctuation">]</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>As you can see, when we call <code class="language-text">delegatedGeneratorFunc()</code> we end up with a generator that will iterate over 11 items even though only 3 were actually added directly within the function. The other 8 were delegated via <code class="language-text">yield*</code>: three from <code class="language-text">awesomeGeneratorFunc()</code> and five from <code class="language-text">range()</code>. <code class="language-text">yield*</code> iterates over the generator object returned by the delegated generator functions and then adds them as items to the main generator object.</p>\n<p>If you picture a normal generator function building up an array instead of a generator, you can think of <code class="language-text">yield</code> as calling <code class="language-text">.push()</code> on an array. If we continue this analogy further, calling <code class="language-text">yield*</code> is like calling <code class="language-text">.splice()</code> to add multiple items to the array.</p>\n<p>As it turns out, <code class="language-text">yield*</code> isn’t just a generator function delegator. The operand of <code class="language-text">yield*</code> (i.e. the value to the right) doesn’t have to be a generator object. It can be any iterable.</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">function</span><span class="token operator">*</span> <span class="token function">iterableGeneratorFunc</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token keyword">yield</span> <span class="token string">\'adios\'</span><span class="token punctuation">;</span>\n    <span class="token keyword">yield</span><span class="token operator">*</span> <span class="token string">\'hello\'</span><span class="token punctuation">;</span>  <span class="token comment">// a string is an iterable!</span>\n    <span class="token keyword">yield</span> <span class="token string">\'au revoir\'</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n\n<span class="token comment">// quickly see contents of generator by converting to an array</span>\n<span class="token comment">// output: [\'adios\', \'h\', \'e\', \'l\', \'l\', \'o\', \'au revoir\']</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token punctuation">[</span><span class="token operator">...</span><span class="token function">iterableGeneratorFunc</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">]</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>Basically <code class="language-text">yield*</code> is iterating over the values of an iterable for us and then <code class="language-text">yield</code>ing those values individually. We can more or less mimic <code class="language-text">yield*</code> using <code class="language-text">for-of</code>:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">function</span><span class="token operator">*</span> <span class="token function">iterableGeneratorFunc</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token keyword">yield</span> <span class="token string">\'adios\'</span><span class="token punctuation">;</span>\n\n    <span class="token keyword">for</span> <span class="token punctuation">(</span><span class="token keyword">let</span> value <span class="token keyword">of</span> <span class="token string">\'hello\'</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token keyword">yield</span> char<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n\n    <span class="token keyword">yield</span> <span class="token string">\'au revoir\'</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p>One other cool thing about <code class="language-text">yield*</code> is that it’s one of the few built-in language constructs that uses the value that’s included when an iterator is done. As we saw earlier with <code class="language-text">awesomeGeneratorFunc()</code> the value returned when a generator is done is specified via <code class="language-text">return</code> in the generator function. In the case of <code class="language-text">awesomeGeneratorFunc()</code> it returns the value <code class="language-text">1000</code>. Let’s create a generator function that will use the <code class="language-text">1000</code> return value from <code class="language-text">awesomeGeneratorFunc</code> to help initialize the <code class="language-text">range()</code> generator.</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">function</span><span class="token operator">*</span> <span class="token function">delegatedGeneratorFuncV2</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token comment">// we\'re still including the 3 items yielded by awesomeGeneratorFunc(),</span>\n    <span class="token comment">// but we\'re also saving the return value in a variable</span>\n    <span class="token keyword">let</span> start <span class="token operator">=</span> <span class="token keyword">yield</span><span class="token operator">*</span> <span class="token function">awesomeGeneratorFunc</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n    <span class="token comment">// we can now use that variable to initialize range()</span>\n    <span class="token keyword">yield</span><span class="token operator">*</span> <span class="token function">range</span><span class="token punctuation">(</span>start<span class="token punctuation">,</span> <span class="token number">3</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n\n<span class="token comment">// output: [\'Generators\', \'are\', \'awesome\', 1000, 1001, 1002]</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token punctuation">[</span><span class="token operator">...</span><span class="token function">delegatedGeneratorFuncV2</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">]</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>Let’s wrap up our learnings on <code class="language-text">yield*</code> with a more concrete example to show the power of generators. It’s a binary tree example taking from the <a href="http://exploringjs.com/es6/ch_generators.html#leanpub-auto-iterating-over-trees">Generators chapter</a> of <a href="https://twitter.com/rauschma">Axel Rauschmayer</a>’s <em>Exploring ES6</em> book.</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">class</span> <span class="token class-name">BinaryTree</span> <span class="token punctuation">{</span>\n    <span class="token function">constructor</span><span class="token punctuation">(</span>value<span class="token punctuation">,</span> left<span class="token punctuation">,</span> right<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token keyword">this</span><span class="token punctuation">.</span>value <span class="token operator">=</span> value<span class="token punctuation">;</span>\n        <span class="token keyword">this</span><span class="token punctuation">.</span>left <span class="token operator">=</span> left<span class="token punctuation">;</span>\n        <span class="token keyword">this</span><span class="token punctuation">.</span>right <span class="token operator">=</span> right<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n\n    <span class="token comment">// default `@@iterator` is a generator function so</span>\n    <span class="token comment">// it needs the `*`</span>\n    <span class="token operator">*</span><span class="token punctuation">[</span>Symbol<span class="token punctuation">.</span>iterator<span class="token punctuation">]</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token keyword">this</span><span class="token punctuation">.</span>left<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n            <span class="token keyword">yield</span><span class="token operator">*</span> <span class="token keyword">this</span><span class="token punctuation">.</span>left<span class="token punctuation">;</span>\n        <span class="token punctuation">}</span>\n\n        <span class="token comment">// Let\'s do infix/in-order iteration</span>\n        <span class="token keyword">yield</span> <span class="token keyword">this</span><span class="token punctuation">.</span>value<span class="token punctuation">;</span>\n\n        <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token keyword">this</span><span class="token punctuation">.</span>right<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n            <span class="token keyword">yield</span><span class="token operator">*</span> <span class="token keyword">this</span><span class="token punctuation">.</span>right<span class="token punctuation">;</span>\n        <span class="token punctuation">}</span>\n    <span class="token punctuation">}</span>\n<span class="token punctuation">}</span>\n\n<span class="token keyword">let</span> tree <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">BinaryTree</span><span class="token punctuation">(</span><span class="token number">4</span><span class="token punctuation">,</span>\n    <span class="token keyword">new</span> <span class="token class-name">BinaryTree</span><span class="token punctuation">(</span><span class="token number">2</span><span class="token punctuation">,</span>\n        <span class="token keyword">new</span> <span class="token class-name">BinaryTree</span><span class="token punctuation">(</span><span class="token number">1</span><span class="token punctuation">)</span><span class="token punctuation">,</span>\n        <span class="token keyword">new</span> <span class="token class-name">BinaryTree</span><span class="token punctuation">(</span><span class="token number">3</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">,</span>\n    <span class="token keyword">new</span> <span class="token class-name">BinaryTree</span><span class="token punctuation">(</span><span class="token number">5</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// output: [1, 2, 3, 4, 5]</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token punctuation">[</span><span class="token operator">...</span>tree<span class="token punctuation">]</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>Now, I don’t have time to explain binary tree traversal with recursion. Chances are you’ve had to write it on a whiteboard during an interview. 😭 You can Google it if you’re unfamiliar. But doing this sort of recursion in a manually-created iterator would be pretty complicated. Using generators and <code class="language-text">yield*</code> makes it just as simple as the normal recursive solution would be.</p>\n<p>In this example we made a <code class="language-text">BinaryTree</code> object an iterable by giving it a <code class="language-text">[Symbol.iterator]()</code> method. We need to prefix the method with <code class="language-text">*</code> because our implementation is using <code class="language-text">yield</code> and <code class="language-text">yield*</code> to return a generator object. Also, because <code class="language-text">BinaryTree</code> is iterable, we can use <code class="language-text">yield*</code> to recursively get all of the items in a subtree (<code class="language-text">this.left</code> or <code class="language-text">this.right</code>) and add them to the main generator object. And this is all done lazily so the depth-first recursion only goes as deep as the generator is iterated. In this example we’re converting the iterable tree into an array, so we end up traversing the entire tree.</p>\n<h2 id="putting-it-all-together"><a href="#putting-it-all-together" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Putting it all together</h2>\n<p>Ok, we’ve spent a lot of time learning about how generators can be used as iterators. We’ve looked at a lot of simple, dummy examples to help us grasp the underlying concepts without too much logic around it. But in the real-world, our code is primarily logic because we’re trying to accomplish a real task. So let’s try to put what we’ve learned together into something we’re more likely to do on a regular basis.</p>\n<p>Let’s mimic <a href="http://underscorejs.org/">underscorejs</a> or <a href="https://lodash.com/">lodash</a>. They both have functions that operate on arrays to map, filter, take, etc. They both have a <code class="language-text">_.chain()</code> method which allows for chaining these functions without creating throwaway intermediary objects. We want to build something similar. However, we’re going to leverage the power of generators so that we don’t have to have realized arrays. Instead, using generators, we can preform these operations on infinite sequences in a lazy manner.</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token comment">// Enumerable class that wraps an iterator exposing methods</span>\n<span class="token comment">// to lazily transform the items</span>\n<span class="token keyword">class</span> <span class="token class-name">Enumerable</span> <span class="token punctuation">{</span>\n    <span class="token function">constructor</span><span class="token punctuation">(</span>iterator<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token comment">// assuming iterator is some sort of iterable</span>\n        <span class="token keyword">this</span><span class="token punctuation">.</span>_iterator <span class="token operator">=</span> iterator<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n\n    <span class="token operator">*</span><span class="token punctuation">[</span>Symbol<span class="token punctuation">.</span>iterator<span class="token punctuation">]</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token keyword">yield</span><span class="token operator">*</span> <span class="token keyword">this</span><span class="token punctuation">.</span>_iterator<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n\n    <span class="token comment">// Static (and private) helper generator functions</span>\n    <span class="token keyword">static</span> <span class="token operator">*</span><span class="token function">_filter</span><span class="token punctuation">(</span>iterator<span class="token punctuation">,</span> predicate<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token keyword">for</span> <span class="token punctuation">(</span><span class="token keyword">let</span> value <span class="token keyword">of</span> iterator<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n            <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token function">predicate</span><span class="token punctuation">(</span>value<span class="token punctuation">)</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n                <span class="token keyword">yield</span> value<span class="token punctuation">;</span>\n            <span class="token punctuation">}</span>\n        <span class="token punctuation">}</span>\n    <span class="token punctuation">}</span>\n    <span class="token keyword">static</span> <span class="token operator">*</span><span class="token function">_map</span><span class="token punctuation">(</span>iterator<span class="token punctuation">,</span> mapperFunc<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token keyword">for</span> <span class="token punctuation">(</span><span class="token keyword">let</span> value <span class="token keyword">of</span> iterator<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n            <span class="token keyword">yield</span> <span class="token function">mapperFunc</span><span class="token punctuation">(</span>value<span class="token punctuation">)</span><span class="token punctuation">;</span>\n        <span class="token punctuation">}</span>\n    <span class="token punctuation">}</span>\n    <span class="token keyword">static</span> <span class="token operator">*</span><span class="token function">_take</span><span class="token punctuation">(</span>iterator<span class="token punctuation">,</span> count<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token keyword">let</span> index <span class="token operator">=</span> <span class="token operator">-</span><span class="token number">1</span><span class="token punctuation">;</span>\n        <span class="token keyword">for</span> <span class="token punctuation">(</span><span class="token keyword">let</span> value <span class="token keyword">of</span> iterator<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n            <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token operator">++</span>index <span class="token operator">>=</span> count<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n                <span class="token keyword">break</span><span class="token punctuation">;</span>\n            <span class="token punctuation">}</span>\n\n            <span class="token keyword">yield</span> value<span class="token punctuation">;</span>\n        <span class="token punctuation">}</span>\n    <span class="token punctuation">}</span>\n\n    <span class="token comment">// Instance methods wrapping functional helpers which allow for chaining</span>\n    <span class="token comment">// The existing iterator is transformed by the helper generator function.</span>\n    <span class="token comment">// The operations haven\'t actually happened yet, just the "instructions"</span>\n    <span class="token function">filter</span><span class="token punctuation">(</span>predicate<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token keyword">this</span><span class="token punctuation">.</span>_iterator <span class="token operator">=</span> Enumerable<span class="token punctuation">.</span><span class="token function">_filter</span><span class="token punctuation">(</span><span class="token keyword">this</span><span class="token punctuation">.</span>_iterator<span class="token punctuation">,</span> predicate<span class="token punctuation">)</span><span class="token punctuation">;</span>\n        <span class="token keyword">return</span> <span class="token keyword">this</span><span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n    <span class="token function">map</span><span class="token punctuation">(</span>mapper<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token keyword">this</span><span class="token punctuation">.</span>_iterator <span class="token operator">=</span> Enumerable<span class="token punctuation">.</span><span class="token function">_map</span><span class="token punctuation">(</span><span class="token keyword">this</span><span class="token punctuation">.</span>_iterator<span class="token punctuation">,</span> mapper<span class="token punctuation">)</span><span class="token punctuation">;</span>\n        <span class="token keyword">return</span> <span class="token keyword">this</span><span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n    <span class="token function">take</span><span class="token punctuation">(</span>count<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token keyword">this</span><span class="token punctuation">.</span>_iterator <span class="token operator">=</span> Enumerable<span class="token punctuation">.</span><span class="token function">_take</span><span class="token punctuation">(</span><span class="token keyword">this</span><span class="token punctuation">.</span>_iterator<span class="token punctuation">,</span> count<span class="token punctuation">)</span><span class="token punctuation">;</span>\n        <span class="token keyword">return</span> <span class="token keyword">this</span><span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n<span class="token punctuation">}</span>\n\n<span class="token keyword">function</span> <span class="token function">generateStocks</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token comment">// Returns an infinite generator that keeps on returning new stocks</span>\n    <span class="token keyword">function</span><span class="token operator">*</span> <span class="token function">_generate</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token keyword">for</span> <span class="token punctuation">(</span><span class="token keyword">let</span> stockNo <span class="token operator">=</span> <span class="token number">1</span><span class="token punctuation">;</span> <span class="token punctuation">;</span> stockNo<span class="token operator">++</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n            <span class="token keyword">let</span> stockInfo <span class="token operator">=</span> <span class="token punctuation">{</span>\n                name<span class="token punctuation">:</span> <span class="token template-string"><span class="token string">`Stock #</span><span class="token interpolation"><span class="token interpolation-punctuation punctuation">${</span>stockNo<span class="token interpolation-punctuation punctuation">}</span></span><span class="token string">`</span></span><span class="token punctuation">,</span>\n                price<span class="token punctuation">:</span> <span class="token operator">+</span><span class="token punctuation">(</span>Math<span class="token punctuation">.</span><span class="token function">random</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token operator">*</span> <span class="token number">100</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">toFixed</span><span class="token punctuation">(</span><span class="token number">2</span><span class="token punctuation">)</span>\n            <span class="token punctuation">}</span><span class="token punctuation">;</span>\n\n            console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">\'Generated stock info\'</span><span class="token punctuation">,</span> stockInfo<span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n            <span class="token keyword">yield</span> stockInfo<span class="token punctuation">;</span>\n        <span class="token punctuation">}</span>\n    <span class="token punctuation">}</span>\n\n    <span class="token keyword">return</span> <span class="token keyword">new</span> <span class="token class-name">Enumerable</span><span class="token punctuation">(</span><span class="token function">_generate</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n\n<span class="token keyword">let</span> enumerable <span class="token operator">=</span> <span class="token function">generateStocks</span><span class="token punctuation">(</span><span class="token punctuation">)</span>\n    <span class="token punctuation">.</span><span class="token function">filter</span><span class="token punctuation">(</span><span class="token punctuation">(</span>stockInfo<span class="token punctuation">)</span> <span class="token operator">=></span> stockInfo<span class="token punctuation">.</span>price <span class="token operator">></span> <span class="token number">30</span><span class="token punctuation">)</span>\n    <span class="token punctuation">.</span><span class="token function">map</span><span class="token punctuation">(</span><span class="token punctuation">(</span>stockInfo<span class="token punctuation">)</span> <span class="token operator">=></span> <span class="token template-string"><span class="token string">`</span><span class="token interpolation"><span class="token interpolation-punctuation punctuation">${</span>stockInfo<span class="token punctuation">.</span>name<span class="token interpolation-punctuation punctuation">}</span></span><span class="token string"> ($</span><span class="token interpolation"><span class="token interpolation-punctuation punctuation">${</span>stockInfo<span class="token punctuation">.</span>price<span class="token interpolation-punctuation punctuation">}</span></span><span class="token string">)`</span></span><span class="token punctuation">)</span>\n    <span class="token punctuation">.</span><span class="token function">take</span><span class="token punctuation">(</span><span class="token number">5</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// Even though `_generate()` is an infinite generator, it\'s also lazy so</span>\n<span class="token comment">// we only look at enough stocks that are > 30 until we get 5 of them</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token punctuation">[</span><span class="token operator">...</span>enumerable<span class="token punctuation">]</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>We’ve basically implemented a (small) portion of <a href="http://danieltao.com/lazy.js">lazy.js</a> or <a href="https://github.com/Reactive-Extensions/RxJS/blob/master/doc/libraries/main/rx.md">RxJs</a> using generators. Congratulations! We’re taking an infinite list of stocks, filtering by the ones that cost over $30, mapping each of those stocks to a display name, and then taking the first 5. Finally we convert that resultant iterator/generator into an array, which we log to the console.</p>\n<p>The cool thing about it is that it’s lazy. It obviously doesn’t create the infinite list of stocks, otherwise it would crash. Instead it only creates enough stocks to get 5 that are over $30. If you run the code, you’ll see that you get less than a dozen <code class="language-text">&#39;Generated stock info&#39;</code> log messages.</p>\n<p>The best way to understand how this all works is to work backwards.</p>\n<p>Let’s start with <code class="language-text">.take()</code> (and <code class="language-text">*_take()</code>). As long as we haven’t gotten to <code class="language-text">count</code> it <code class="language-text">yield</code>s the value from the iterator. Each iteration in the <code class="language-text">for-of</code> loop retrieves the next value from its iterator. But that iterator is actually a generator from <code class="language-text">.map()</code> (and <code class="language-text">*_map()</code>). So the first <code class="language-text">value</code> in the <code class="language-text">for-of</code> loop within <code class="language-text">*_take()</code> is actually the first value <code class="language-text">yield</code>ed by <code class="language-text">*_map()</code>, the second <code class="language-text">value</code> is the second value <code class="language-text">yield</code>ed by <code class="language-text">*_map()</code>, and so on.</p>\n<p>Similarly within <code class="language-text">*_map()</code>, each iteration in the <code class="language-text">for-of</code> loop retrieves the next value from its iterator. That value is <code class="language-text">yield</code>ed after transforming it by <code class="language-text">mapperFunc</code>. And its iterator is actually the generator returned by <code class="language-text">.filter()</code> and <code class="language-text">*_filter()</code>. So the first <code class="language-text">value</code> in the <code class="language-text">for-of</code> loop within <code class="language-text">*_map()</code> is actually the first value <code class="language-text">yield</code>ed by <code class="language-text">*_filter()</code>, and so on.</p>\n<p><code class="language-text">*_filter()</code> uses a <code class="language-text">for-of</code> loop to iterate over the values of its iterator and only <code class="language-text">yield</code>s a value if the <code class="language-text">predicate</code> function returns <code class="language-text">true</code>. Well that iterator is the generator object returned by <code class="language-text">generateStocks()</code>. Each iteration of the <code class="language-text">for-of</code> loop is pulling out values from the generator, which <code class="language-text">generateStocks()</code> is <code class="language-text">yield</code>ing with a random price.</p>\n<p>The reason why the program doesn’t crash even though <code class="language-text">generateStocks()</code> will continue to <code class="language-text">yield</code> random stocks as long as they are requested, is because <code class="language-text">*_take()</code> quits <code class="language-text">yield</code>ing values after it has reached <code class="language-text">count</code> number of values. Because no more <code class="language-text">yield</code>s happen, the chain reactions end and <code class="language-text">generateStocks()</code> stops <code class="language-text">yield</code>ing random stocks.</p>\n<p>Sweeet!</p>\n<h2 id="javascript-engine-support"><a href="#javascript-engine-support" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>JavaScript engine support</h2>\n<p>According to the <a href="http://kangax.github.io/compat-table/es6/">ECMAScript 6 Compatibility table</a>, only Safari 9 doesn’t support generator functions. All other modern browsers and engines support them.</p>\n<h2 id="additional-resources"><a href="#additional-resources" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Additional resources</h2>\n<p>As always, you can check out the <a href="/learning-es6/#generators"><em>Learning ES6</em> examples page</a> for the <a href="https://github.com/benmvp/learning-es6"><em>Learning ES6</em> Github repo</a> where you will find all of the code used in this article running natively in the browser. You can also get some practice with ES6 classes using <a href="http://es6katas.org/">ES6 Katas</a>.</p>\n<p>For more on using generators as iterators feel free to read:</p>\n<ul>\n<li><a href="http://exploringjs.com/es6/ch_generators.html">Generators</a> in <a href="http://exploringjs.com/es6/"><em>Exploring ES6</em></a> by <a href="https://twitter.com/rauschma">Axel Rauschmayer</a></li>\n<li><a href="https://leanpub.com/understandinges6/read#leanpub-auto-iterators-and-generators">Iterators and Generators</a> in <a href="https://leanpub.com/understandinges6/"><em>Understanding ECMAScript 6</em></a> by <a href="https://twitter.com/slicknet">Nicholas C. Zakas</a></li>\n<li><a href="http://ponyfoo.com/articles/es6-generators-in-depth">ES6 Generators in Depth</a> in <a href="http://ponyfoo.com/articles/tagged/es6-in-depth"><em>ES6 in Depth</em></a> by <a href="https://twitter.com/nzgb">Nicolas Bevacqua</a></li>\n<li><a href="https://hacks.mozilla.org/2015/05/es6-in-depth-generators/">ES6 In Depth: Generators</a> in <a href="https://hacks.mozilla.org/category/es6-in-depth/"><em>ES6 in Depth</em></a> by <a href="https://twitter.com/jorendorff">Jason Orendorff</a></li>\n<li><a href="https://hacks.mozilla.org/2015/07/es6-in-depth-generators-continued/">ES6 In Depth: Generators, continued</a> in <a href="https://hacks.mozilla.org/category/es6-in-depth/"><em>ES6 in Depth</em></a> by <a href="https://twitter.com/jorendorff">Jason Orendorff</a></li>\n</ul>\n<h2 id="coming-up-next"><a href="#coming-up-next" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Coming up next…</h2>\n<p>So we just looked at how we can use generator functions to easily create generator objects that are iterators. But that’s only half the story! Generator objects not only can act as data producers (aka iterators), but they can also act as data consumers (aka observers). Up next, we’ll continue our deep dive into generators, looking at how we can use them to <em>consume</em> data. This is where the asynchronous magic really happens. I had initially planned to just do one big article on generators that covered both sides, but it’s clearly too big for just one article. Even this article post could’ve been split into two.</p>\n<p>Until then…</p>',
fields:{slug:"/learning-es6-generators-as-iterators/",prefix:"2016-01-13"},frontmatter:{title:"Generators as iterators",subTitle:"The Learning ES6 Series",cover:{childImageSharp:{resize:{src:"/static/electric-generator-93d0cfb5a7cb2fba0ba4606254ef2a37-ada8c.jpg"}}}}},author:{id:"/home/travis/build/benmvp/benmvp.github.io/content/parts/author.md absPath of file >>> MarkdownRemark",html:'<p>Ben is a Christian, husband and father of 2 girls, with a dozen years of experience developing user interfaces for the Web. He currently is a Principal Frontend Engineer at Eventbrite on the Frontend Platform team, focused on improving their React-based design system and frontend infrastructure. Ben also enjoys playing basketball, DIY, watching movies, and <a href="https://twitter.com/benmvp">tweeting</a> / <a href="http://www.benmvp.com">blogging</a> about his experiences with new web technologies.</p>'},footnote:{id:"/home/travis/build/benmvp/benmvp.github.io/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:'<ul>\n<li>© Ben Ilegbodu 2018.</li>\n<li>Powered by <a href="https://www.gatsbyjs.org/">Gatsby</a> &#x26; <a href="https://reactjs.org">React</a> using <a href="https://github.com/greglobinski/gatsby-starter-personal-blog">gatsby-starter-personal-blog</a>.</li>\n</ul>'}},pathContext:{slug:"/learning-es6-generators-as-iterators/"}}}});
